export interface ProductState {
    getProducts: Product[],

    productWithFilter: Product[],
    productWithoutFilter: Product[],

    productsWithoutFilter: any[],
    displayProductsWithoutFilter: any[]

    displayProducts: any[],
    filterByBrand: number[],

    startDisplayInd: number,
    countDisplayProduct: number,
    pageProduct: number,
}

export interface Product {
    type: string,
    id: number,
    sku: string,
    title: string,
    regular_price: {
      currency: string,
      value: number
    },
    image: string,
    brand: number,
}

export enum ProductsActionTypes{
    GET_ALL_PRODUCT = "GET_ALL_PRODUCT",
    VIEW_PRODUCTS = "VIEW_PRODUCTS",

    SET_BRANDS_FILTER = "SET_BRANDS_FILTER",

    GO_TO_NEXT_PAGE = "GO_TO_NEXT_PAGE",
    GO_TO_PREVIOUS_PAGE = "GO_TO_PREVIOUS_PAGE",

}

interface getProductAction {
    type: ProductsActionTypes.GET_ALL_PRODUCT,
    payload: any[],
}

interface viewProductsAction {
    type: ProductsActionTypes.VIEW_PRODUCTS,
    payload: number,
}

interface setBrandsFilterAction {
    type: ProductsActionTypes.SET_BRANDS_FILTER,
    payload: number,
}

interface goToNextPageAction {
    type: ProductsActionTypes.GO_TO_NEXT_PAGE,
    payload: number,
}

interface goToPreviousPageAction {
    type: ProductsActionTypes.GO_TO_PREVIOUS_PAGE,
    payload: number,
}

export type ProductsActions = 
getProductAction |
viewProductsAction |
setBrandsFilterAction |
goToNextPageAction |
goToPreviousPageAction
